import React from 'react'
import eastTeams from '../eastTeams'
import westTeams from '../westTeams'
import Image from 'react-'
const Teams = () => {
    return (
        <div>
                    EAST
                    {eastTeams.map(east => (
                        <p>{east.teamName}</p>
                    ))}     

                    West

                    {westTeams.map(west => (
                        <p>{west.teamName}</p>
                    ))}      
        </div>
    )
}

export default Teams
